class Solution:
    # @return an integer
    def lengthOfLongestSubstring(self, s):
        ans = 0;
        hash = [-1] * 256;        
        start = 0;        
        for i in range(len(s)):
            if (hash[ord(s[i])] != -1) :
                k = hash[ord(s[i])];
                start = max(start, k + 1);
            
            ans = max(ans, i - start + 1);
            hash[ord(s[i])] = i;
        return ans;
